@FILE968.text:
//***FILE 968 is from John McKown and contains utilities written    *   FILE 968
//*           by him.  The first utility included is an             *   FILE 968
//*           ISRDDN-like TSO command called SYSPARM.  SYSPARM      *   FILE 968
//*           concatenates the PARMLIB datasets and performs an     *   FILE 968
//*           ISRDDN-like action on them, showing you your PARMLIB  *   FILE 968
//*           concatenation in ISRDDN format, so that you can see   *   FILE 968
//*           which members override, etc.                          *   FILE 968
//*                                                                 *   FILE 968
//*           email:  John McKown <john.archie.mckown@gmail.com>    *   FILE 968
//*                                                                 *   FILE 968
//*           Note that assembly/linkedit JCL is provided in        *   FILE 968
//*           member SYSPARM$, because the LE stuff has to be       *   FILE 968
//*           included, and it is not straightforward if you        *   FILE 968
//*           don't know how to include that stuff.                 *   FILE 968
//*                                                                 *   FILE 968

SYSPARM$.text:
//SBGOLOBU JOB (CCMVS),ASMLINK,
// NOTIFY=&SYSUID,
// CLASS=B,MSGCLASS=X,COND=(1,LT)
//*
//*     ASM LINKEDIT FROM SOURCE ASM
//*
//ASMH EXEC PGM=ASMA90,
//     PARM='OBJECT,NODECK,ESD,RLD,BATCH,FLAG(5)'
//SYSLIB   DD DISP=SHR,DSN=SYS1.MACLIB
//         DD DISP=SHR,DSN=SYS1.MODGEN
//         DD DISP=SHR,DSN=CEE.SCEEMAC
//SYSIN    DD DISP=SHR,DSN=SBGOLOB.CBT495.FILE968(SYSPARM)
//SYSUT1   DD UNIT=SYSALLDA,SPACE=(CYL,(2,2))
//SYSPRINT DD SYSOUT=*
//SYSLIN   DD UNIT=SYSALLDA,SPACE=(CYL,(4,4)),DISP=(,PASS),
//            DCB=BLKSIZE=3200,
//            DSN=&&TEMP
//*
//LKED   EXEC  PGM=HEWL,
//       PARM='MAP,LIST,LET,RENT,CALL'
//SYSUT1   DD  UNIT=SYSDA,SPACE=(2048,(200,20))
//SYSPRINT DD  SYSOUT=*
//SYSLIB   DD  DISP=SHR,DSN=CEE.SCEELKED
//         DD  DISP=SHR,DSN=SYS1.MIGLIB
//SYSLMOD  DD  DISP=SHR,DSN=SYS1.W$$.LINKLIB
//OBJECT   DD  DISP=(OLD,DELETE),DSN=&&TEMP
//SYSLIN   DD  *
 INCLUDE OBJECT
 ENTRY   SYSPARM
 SETSSI  CB495968
 SETCODE AC(0)
 NAME    SYSPARM(R)
